    private async Task PerformRegister()
    {
        try
        {
            await _serviceUser.RegisterUser(profile);
            errorMessage = "";
            NavigationManager.NavigateTo("/ManageEmployee");
        }
        catch (Exception e)
        {
            Console.WriteLine(e.Message);
            errorMessage = e.Message;
        }
    }

